<!DOCTYPE html>
<html>

<head>
    <title>Test Report</title>
    <style>
        body {
            background: #173529;
        }

        .container {
            width: 1000px;
            margin: 0 auto;
            padding: 10px;
            font-family: Arial, Helvetica, sans-serif;
            font-size: 14px;
            color: #ecf3ee;
        }

        .info span {
            color: #b3c3bc;
        }

        .charts-container .chart {
            width: 100%;
            height: 350px;
            margin-bottom: 30px;
        }

        .download {
            float: right;
        }

        .download a {
            color: #00ca5a;
        }

        /* tables.css */
        table.stats {
            width: 100%;
            border-radius: 3px;
            border: 2px solid #11251c;
            border-spacing: 0;
            margin-bottom: 30px;
        }

        table.stats thead {
            padding: 0;
            margin: 0;
            color: #a9c5ba;
        }

        table.stats thead tr {
            background: #11251c;
        }

        table.stats thead tr:nth-child(even) {
            background: #11251c;
        }

        table.stats thead tr:hover {
            background: #11251c;
        }

        table.stats thead th {
            font-weight: bold;
            cursor: default;
        }

        table.stats thead th.nowrap {
            white-space: nowrap;
        }

        table.stats thead th[data-sortkey] {
            cursor: pointer;
        }

        table.stats tr:hover {
            background: #1d4434;
        }

        table.stats tr td,
        table.stats tr th {
            padding: 10px;
            margin: 0;
            text-align: left;
        }

        table.stats tr td:first-child,
        table.stats tr th:first-child {
            padding-left: 16px;
        }

        table.stats tr td:last-child,
        table.stats tr th:last-child {
            padding-right: 16px;
        }

        table.stats tr td.numeric,
        table.stats tr th.numeric {
            text-align: right;
        }

        table.stats tr td {
            max-width: 450px;
            overflow: hidden;
            word-wrap: break-word;
            white-space: no-wrap;
            text-overflow: ellipsis;
        }

        @media (max-width: 1100px) {
            table.stats tr td {
                max-width: 350px;
            }
        }

        table.stats tr:nth-child(even) {
            background: #153126;
        }

        table.stats tr:nth-child(even):hover {
            background: #1d4434;
        }

        table.stats tr.total {
            background: #11251c;
        }

        table.stats tr.total td {
            font-weight: bold;
        }

        /*# sourceMappingURL=tables.css.map */
    </style>
</head>

                    console && console.error && console.error(msg);
                }

                log('ECharts is not Loaded');

    <script>

        (function () {
            class LocustLineChart {
                /**
                 * lines should be an array of line names
                 */
                constructor(container, title, lines, unit, colors) {
                    this.container = $(container);
                    this.title = title;
                    this.lines = lines;

                    this.element = $('<div class="chart"></div>').css("width", "100%").appendTo(container);
                    this.data = [];
                    this.dates = [];

                    var seriesData = [];
                    for (var i = 0; i < lines.length; i++) {
                        seriesData.push({
                            name: lines[i],
                            type: 'line',
                            showSymbol: true,
                            hoverAnimation: false,
                            data: [],
                        });
                        this.data.push([]);
                    }

                    this.chart = echarts.init(this.element[0], 'vintage');
                    this.chart.setOption({
                        legend: {
                            icon: 'circle',
                            inactiveColor: '#b3c3bc',
                            textStyle: {
                                color: '#b3c3bc',
                            }
                        },
                        title: {
                            text: this.title,
                            x: 10,
                            y: 10,
                        },
                        tooltip: {
                            trigger: 'axis',
                            formatter: function (params) {
                                if (!!params && params.length > 0 && params.some(param => !!param.value)) {
                                    var str = params[0].name;
                                    params.sort((a, b) => (a.data.value > b.data.value) ? -1 : ((b.data.value > a.data.value) ? 1 : 0));
                                    for (var i = 0; i < params.length; i++) {
                                        var param = params[i];
                                        str += '<br><span style="color:' + param.color + ';">' + param.seriesName + ': ' + param.data.value;
                                        if (param.data.users != undefined) {
                                            str += '  Users: ' + param.data.users;
                                        }
                                        str += '</span>';
                                    }
                                    return str;
                                } else {
                                    return "No data";
                                }
                            },
                            axisPointer: {
                                animation: true
                            },
                            textStyle: {
                                color: '#b3c3bc',
                                fontSize: 13,
                            },
                            backgroundColor: 'rgba(21,35,28, 0.93)',
                            borderWidth: 0,
                            extraCssText: "z-index:1;",
                        },
                        xAxis: {
                            type: 'category',
                            splitLine: {
                                show: false
                            },
                            axisLine: {
                                lineStyle: {
                                    color: '#5b6f66',
                                },
                            },
                            data: this.dates,
                        },
                        yAxis: {
                            type: 'value',
                            boundaryGap: [0, '5%'],
                            splitLine: {
                                show: false
                            },
                            axisLine: {
                                lineStyle: {
                                    color: '#5b6f66',
                                },
                            },
                        },
                        series: seriesData,
                        grid: { x: 60, y: 70, x2: 40, y2: 40 },
                        color: colors,
                        toolbox: {
                            feature: {
                                saveAsImage: {
                                    name: this.title.replace(/\s+/g, '_').toLowerCase() + '_' + Date.parse(new Date()) / 1000,
                                    title: "Download as PNG"
                                }
                            }
                        }
                    })
                }

                addValue(values, user_count = 0) {
                    this.dates.push(new Date().toLocaleTimeString());
                    var seriesData = [];
                    for (var i = 0; i < values.length; i++) {
                        var value = Math.round(values[i] * 100) / 100;
                        this.data[i].push({ "value": value, "users": user_count });
                        seriesData.push({ data: this.data[i] });
                    }
                    this.chart.setOption({
                        xAxis: {
                            data: this.dates,
                        },
                        series: seriesData
                    });
                }

                resize() {
                    this.chart.resize();
                }
            }
            window.LocustLineChart = LocustLineChart;
        })();
    </script>
